import java.util.Scanner;

class Student{
	public String name;
	String number;
	private int age;
	public Student(String a,String b,int c) {
		name = b;
		number = a;
		age = c;
	}
	String display(){
		String str;
		if(age>=7&&age<=60) {
			str=name+" "+number+" "+age;
		}else {
			str = "bad";
		}
		return str;
	}
}


public class Main {
	public static void main(String[] args) {
		Scanner in = new Scanner(System.in);
		int n = in.nextInt();
		String str[] = new String[n];
		for(int i=0;i<n;i++) {
			Student stu = new Student(in.next(),in.next(),in.nextInt());
			str[i]=stu.display();
		}
		for(int i=0;i<n;i++) {
			System.out.println(str[i]);
		}
	}
}

