import java.util.Scanner;
import java.util.regex.Pattern;


public class Main {
    public static void main(String[] args) {
        Scanner in = new Scanner(System.in);
        int m = in.nextInt();
        int n = in.nextInt();
        int[][] array = new int[m][n];
        int r = in.nextInt();
        if (!(r == 90 || r == 180 || r == -90)) {
            System.out.println("angle data error");
            System.exit(0);
        }else
            for (int i = 0; i < m; ++i) {
                for (int j = 0; j < n; ++j) {
                    String str = in.next();
                    if (isInteger(str)) {
                        int a = Integer.parseInt(str);
                        if (a < 0 || a > 255) {
                            System.out.print("matrix data error");
                            System.exit(0);
                        }
                        array[i][j] = a;
                    } else {
                        System.out.print("data type error");
                        System.exit(0);
                    }
                }
            }

            int[][] num2 =  turn(array,m,n,r);
            for(int i=0;i<num2.length;++i) {
                int[] num=num2[i];
                for(int j=0;j<num.length;++j) {
                    System.out.print(num[j]);
                    if(j!=num.length-1)
                        System.out.print(" ");
                }
                if(i!=num2.length)
                    System.out.println();
            } 
    }



    public static boolean isInteger(String str) {
        if (null == str || "".equals(str)) {
            return false;
        }
        Pattern pattern = Pattern.compile("^[-\\\\+]?[\\\\d]*$");
        return pattern.matcher(str).matches();
    }
    public static int[][] turn(int[][] array,int m,int n,int status){
        int[][] array2=null;
        if (status == -90){
            array2 = new int[n][m];
            for(int i=0;i<n;++i){
                for(int j=0;j<m;++j){
                    array2[i][j] = array[m-1-j][i];
                }
            }
        }else if(status ==180){
            array2 = new int[m][n];
            int[][] array1 = turn(array,m,n,-90);
            array2=turn(array1,n,m,-90);
        }else if(status ==90){
            array2 = new int[n][m];
            int[][] array1 = turn(array,m,n,180);
            array2 =turn(array1,m,n,-90);
        }
        return array2;
    }

}

