          b[i] = in.nextInt();
       }

       int t=0;

       for(int j=0 ; j<m ; j++){
          for(int i=0 ; i<n ; i++){
            if(i+1==b[j]){
                 t=a[i];
              for(int k=i ; k<n-1 ; k++){
                  a[k]=a[k+1];
              }
                a[n-1]=t;
            }
          }
       }
