        int n=in.nextInt();
        int[] num=new int[n];
        for (int i=0;i<n;i++)
            num[i]=in.nextInt();
        int k=in.nextInt();
        for(int i=0;i<k;i++){
            int count=in.nextInt();
            int temp=num[count-1];
            for (int j=count-1;j<n-1;j++){
                num[j]=num[j+1];
            }
                num[n-1]=temp;
        }
        for (int i=0;i<n-1;i++)
            System.out.print(num[i]+" ");
        System.out.print(num[n-1]);
    }
}

