import java.util.Arrays;
import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner in = new Scanner(System.in);
        String a = in.nextLine();

        String[]b=a.split(" ");
        int[]c=new int[b.length];
        for (int i=0;i<b.length;i++){
           c[i]=Integer.valueOf(b[i]);
        }
        for (int shu:c){
            System.out.println(shu);
        }
        int aa=0,bb=0;
        int max= Arrays.stream(c).max().getAsInt();
        for (aa=0;aa<c.length;aa++){
            if (c[aa]==max){
                break;
            }
        }
        int min=Arrays.stream(c).min().getAsInt();
        for (bb=0;bb<c.length;bb++){
            if (c[bb]==min){
                break;
            }
        }
        swap(c,aa,0);
        swap(c,bb,c.length-1);
        for (int shu:c){
            System.out.println(shu);
        }
    }
    public static void swap(int[]c,int a,int b){
        int temp=c[b];
        c[b]=c[a];
        c[a]=temp;
    }
}

