		Scanner sc = new Scanner(System.in);
		Shape zheng = new Square(sc.nextDouble());
		Shape chang = new Rectangle(sc.nextDouble(), sc.nextDouble());
		Shape yuan = new Circle(sc.nextDouble());
		System.out.printf("%.2f %.2f\n",zheng.getPerimater() , zheng.getArea());
		System.out.printf("%.2f %.2f\n",chang.getPerimater() , chang.getArea());
		System.out.printf("%.2f %.2f\n",yuan.getPerimater() , yuan.getArea());



	}

}
abstract class Shape{


	public abstract double getPerimater();

	public abstract double getArea() ;

}
 class Square extends Shape{
	 private double bian;




	public Square(double bian) {
		super();
		this.bian = bian;
	}


	@Override
	public double getPerimater() {

		// TODO Auto-generated method stub
		return bian*4;
	}

	@Override
	public double getArea() {
		// TODO Auto-generated method stub
		return bian*bian;
	}


}
class Rectangle extends Shape{

	private double chang;
	private double kuan;

	public Rectangle(double chang, double kuan) {
		super();
		this.chang = chang;
		this.kuan = kuan;
	}
	@Override
	public double getPerimater() {
		// TODO Auto-generated method stub
		return 2*(chang + kuan);
	}
	@Override
	public double getArea() {
		// TODO Auto-generated method stub
		return chang * kuan;
	}



}
class Circle extends Shape{
	private double banjing;


	public Circle(double banjing) {
		super();
		this.banjing = banjing;
	}

	@Override
	public double getPerimater() {
		// TODO Auto-generated method stub
		return 2*Math.PI * banjing;
	}

	@Override
	public double getArea() {
		// TODO Auto-generated method stub
		return Math.PI * banjing * banjing;
	}

}

