import java.util.Scanner;
public class Main{
    public static void main(String[] args) {
        Scanner in = new Scanner(System.in);
        int a = in.nextInt();
        int sum = 0;
        int[][] Matrix = new int[a][a];
        for(int i= 0;i<a;i++){
            for(int j = 0;j<a;j++){
                Matrix[i][j] = in.nextInt();
            }
        }
        int index = a%2;
        for(int i = 0;i<a;i++){
            sum+=Matrix[i][i]+Matrix[a-i-1][i];
        }
        if(index!=0){
            sum-=Matrix[a/2][a/2];
        }
        System.out.println(sum);
    }
}

