        String substr;
        while(jin.hasNextInt())
        {
            n=jin.nextInt();
            begin=jin.nextInt();
            end=jin.nextInt();
            str=creatString(n);
            substr=str.toString();
            System.out.println(substr.substring(begin,end));
        }
    }

