import java.util.Scanner;
import java.lang.Math;
abstract class Shape{
    public  abstract double getPerimeter();
    public abstract double getArea();
}
class Square extends Shape{
    public double bian;
     public Square(double bian){
         this.bian=bian;
     }
     public double getPerimeter(){
       return 4*bian;
    }
    public double getArea(){
        return bian*bian;
    }
}
class Rectangle extends Shape{
    public double height;
    public double width;
     public Rectangle(double height,double width){
         this.height=height;
         this.width=width;
     }
     public double getPerimeter(){
       return 2*height+2*width;
    }
    public double getArea(){
        return height*width;
    }
}
class Circle extends Shape{
    public double radis;
     public Circle(double radis){
         this.radis=radis;
     }
     public double getPerimeter(){
       return (Math.PI)*radis*2;
    }
    public double getArea(){
        return (Math.PI)*radis*radis;
    }
}
public class Main{
    public static void main(String[]args){
        Scanner in=new Scanner(System.in);
        Square a=new Square(in.nextDouble());
        Rectangle b=new Rectangle(in.nextDouble(),in.nextDouble());
        Circle c=new Circle(in.nextDouble());
        double p=a.getPerimeter();
        double o=a.getArea();
         double i=b.getPerimeter();
        double  u=b.getArea();
         double y=c.getPerimeter();
       double t=c.getArea();
        System.out.printf("%.2f %.2f\n",p,o);
        System.out.printf("%.2f %.2f\n",i,u);
        System.out.printf("%.2f %.2f\n",y,t);
    }
}

