import java.util.*;
public class Main {
    public static void main(String[] args) {
        int n;
        int result;
        Scanner sc=new Scanner(System.in);
        n=sc.nextInt();
        result=shu(n);
        System.out.println(result);
    }
    public static int shu(int n){
        if(n==1){
            return 1;
        }else if(n==2){
            return 2;
        }else{
            return shu(n-1)+shu(n-2);
        }
    }
}

