import java.util.Arrays;
import java.util.Scanner;

public class Main {
	public static void main(String[] args) {
		Scanner sc=new Scanner(System.in);
		int n=sc.nextInt();
		sc.nextLine();
		Shape[] shapes=new Shape[n];
		for(int i=0;i<n;i++) {
			String s=sc.nextLine();
            if (s.equals("rect")){
            	int width=sc.nextInt();
                int length=sc.nextInt();
                shapes[i]=new Rectangle(width,length);
                sc.nextLine();
            }else if (s.equals("cir")){
                shapes[i]=new Circle(sc.nextInt());
                sc.nextLine();
            }
		}
		System.out.println(sumAllPerimeter(shapes));
        System.out.println(sumAllArea(shapes));
        System.out.println(Arrays.toString(shapes));
        for (Shape s: shapes) {
            System.out.println(s.getClass()+","+s.getClass().getSuperclass());
        }
    }

    public static double sumAllArea(Shape[] ss){
        double sum=0;
        for (Shape s : ss) {
            sum += s.getArea();
        }
    return sum;
    }

    public static double sumAllPerimeter(Shape[] ss){
    double sum=0;
        for (Shape s:ss) {
            sum+=s.getPerimeter();
        }
    return sum;

	}

}
abstract class Shape {
	public static double PI=3.14;
	public abstract double getPerimeter();//抽象均加 abstract
	public abstract double getArea();
}
class Rectangle extends Shape{
    private int width;
    private int length;
	public Rectangle(int width, int length) {
		super();
		this.width = width;
		this.length = length;
	}

	public int getWidth() {
		return width;
	}

	public void setWidth(int width) {
		this.width = width;
	}

	public int getLength() {
		return length;
	}

	public void setLength(int length) {
		this.length = length;
	}


    public double getArea() {
    	return width*length;
    }
    public double getPerimeter() {
    	return 2*(width+length);
    }
	public String toString() {
		return "Rectangle [width=" + width + ", length=" + length + "]";
	}

}
class Circle extends Shape{
	private int radius;

	public Circle() {
		super();
	}

	public Circle(int radius) {
		super();
		this.radius = radius;
	}

	public int getRadius() {
		return radius;
	}

	public void setRadius(int radius) {
		this.radius = radius;
	}
	public double getArea() {
		return Math.pow(radius, 2)*PI;
    }
	public double getPerimeter() {
		return 2*radius*PI;
    }

	public String toString() {
		return "Circle [radius=" + radius + "]";
	}

}

