                scan.nextLine();
				shape[i]=new Rectangle(wid,len);
			}
			if(s.equals("cir")) {
				int rad=scan.nextInt();
                scan.nextLine();
				shape[i]=new Circle(rad);
			}
		}
		System.out.println(sumAllPerimeter(shape));
        System.out.println(sumAllArea(shape));
		System.out.println(Arrays.toString(shape));
		for (Shape s: shape) {
            System.out.println(s.getClass()+","+s.getClass().getSuperclass());
        }
    }

    public static double sumAllArea(Shape[] ss){
        double sum=0;
        for (Shape s : ss) {
            sum += s.getArea();
        }
    return sum;
    }

    public static double sumAllPerimeter(Shape[] ss){
    double sum=0;
        for (Shape s:ss) {
            sum+=s.getPerimeter();
        }
    return sum;
    }

}
abstract class Shape {
	static double PI=3.14;
    public abstract double getPerimeter();
    public abstract double getArea();

}
class Rectangle extends Shape {
	private int width;
    private int length;

    public Rectangle(int width, int length) {
    	super();
        this.width = width;
        this.length = length;
    }

    public int getWidth() {
        return width;
    }

    public void setWidth(int width) {
        this.width = width;
    }

    public int getLength() {
        return length;
    }

    public void setLength(int length) {
        this.length = length;
    }

    public double getPerimeter(){
        return 2.0*(this.length+this.width);
    }

    public double getArea(){
        return this.length*this.width;
    }

	public String toString() {
		return "Rectangle [width=" + width + ", length=" + length + "]";
	}

}
class Circle extends Shape{
	private int radius;

    public Circle(int radius) {
        this.radius = radius;
    }

    public int getRadius() {
        return radius;
    }

    public void setRadius(int radius) {
        this.radius = radius;
    }
    public double getPerimeter(){
        return 2*PI*this.radius;
    }

    public double getArea(){
        return PI*Math.pow(this.radius,2);
    }

	@Override
	public String toString() {
		return "Circle [radius=" + radius + "]";
	}

}

