import java.util.Scanner;

public class Main {
	public static void main(String[] args) {
		Scanner in = new Scanner(System.in);
		int n = in.nextInt();
		int a[] = new int[n];
		for(int i=0;i<n;i++){
			a[i]= in.nextInt();
		}
		int m = in.nextInt();//交换次数
		for(int j=0;j<m;j++) {
			int x =in.nextInt();
			int temp = 0;
			for(int k=0;k<n;k++) {
				if(k==x-1) {
					temp = a[k];
					for(int t=k;t<n-1;t++) {
						a[t]= a[t+1];	
					}
					a[n-1]= temp;
				}
			}
		}
		for(int i=0;i<n-1;i++) {
		   System.out.print(a[i]+" ");
		}
		System.out.println(a[n-1]);
	}
}

