import java.util.Scanner;
public class Main {
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc = new Scanner(System.in);
		int n = sc.nextInt();
		int a[][] = new int[n][n];
		for(int i=0;i<n;i++) {
			for(int j=0;j<=i;j++) {
				if(j==0 || j==i) {
					a[i][j]=1;
				}
			}
		}
		for(int i=2;i<n;i++) {
			for(int j=1;j<i;j++) {
				a[i][j]=a[i-1][j-1]+a[i-1][j];
			}
		}
        int sum=0;
		for(int i=0;i<n;i++) {
            sum++;
			for(int j=0;j<=i;j++) {
				System.out.printf("%-4d",a[i][j]);
			}
            if(sum!=n) {
			System.out.println("");
			}
		}
	}
}

