        String s1 = "";
        for (int i = 3; i >= 0 ; i--) {
            s1 += a[i];
        }
        String s2 = "";
        for (int i = 0; i < 4; i++) {
            s2 += a[i];
        }
        System.out.println(Integer.parseInt(s1)+" "+Integer.parseInt(s2));
    }
}

