import java.text.DecimalFormat;
import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int sumMaxPassengerCapacity = 0;
        double sumMaxLoadCapacity = 0;
        int sumMoney = 0;

        while(true) {
            int flag = sc.nextInt();
            if(flag == 0) {
                break;
            }
            int num = sc.nextInt();
            Car[] c = new Car[10];
            c[0] = new Car(5,800);
            c[1] = new Car(5,400);
            c[2] = new Car(5,800);
            c[3] = new Car(51,1300);
            c[4] = new Car(55,1500);
            c[5] = new Car(5,0.45,500);
            c[6] = new Car(5,2.0,450);
            c[7] = new Car(3.0,200);
            c[8] = new Car(25.0,1500);
            c[9] = new Car(35.0,2000);
            for (int i = 0; i < num; i++) {
                int type = sc.nextInt();
                int count = sc.nextInt();
                sumMaxPassengerCapacity += count*c[type-1].maxPassengerCapacity;
                sumMaxLoadCapacity += count*c[type-1].maxLoadCapacity;
                sumMoney += count*c[type-1].money;
            }
            break;
        }

        String format = new DecimalFormat("0.00").format(sumMaxLoadCapacity);
        System.out.println(sumMaxPassengerCapacity + " " + format + " " + sumMoney);
    }
}

class Car {
    public int maxPassengerCapacity;
    public double maxLoadCapacity;
    public int money;

    public Car(int maxPassengerCapacity, int money) {
        this.maxPassengerCapacity = maxPassengerCapacity;
        this.money = money;
    }

    public Car(double maxLoadCapacity, int money) {
        this.maxLoadCapacity = maxLoadCapacity;
        this.money = money;
