public class Main {

	public static void fun(int [] a, int n) {
		int t = a[n - 1];
		for(int i = n - 1; i < a.length - 1; ++ i) {
			a[i] = a[i + 1];
		}
		a[a.length - 1] = t;
	}

	public static void main(String[] args) {
		Scanner cin = new Scanner(System.in);
		int n = cin.nextInt();
		int k;

		int [] a = new int[n];

		for(int i = 0; i < n; ++ i ) {
			a[i] = cin.nextInt();
		}

		k = cin.nextInt();
		for(int i = 0; i < k; i ++) {
			fun(a, cin.nextInt());
		}

		for(int i = 0; i < n - 1;  ++ i ) {
			System.out.print(a[i] + " ");
		}
		System.out.println(a[a.length - 1]);
	}
}

