		Scanner scan =new Scanner(System.in);
		String a = "A";
		String b = "B";
		String c = "C";
		String d = "D";
		String e = "E";
		String t = "f";
		int i = 5;
		while (i>0) {
			int m=scan.nextInt();
			if(m==1) {
				t=a;
				a=b;
				b=t;
				t=b;
				b=c;
				c=t;
				t=c;
				c=d;
				d=t;
				t=d;
				d=e;
				e=t;
			}
			else if(m==2) {
				t=e;
				e=d;
				d=t;
				t=d;
				d=c;
				c=t;
				t=c;
				c=b;
				b=t;
				t=b;
				b=a;
				a=t;
			}
			else {
				t=a;
				a=b;
				b=t;
			}
			i--;
		}
		System.out.print(a+","+b+","+c+","+d+","+e);
	}
}

