public class Main {

public static void main(String[] args) {
Scanner s = new Scanner(System.in);
int n = s.nextInt();
double sum = 0;
String[] a = new String[n];
for (int i = 0; i < n; i++) {
a[i] = s.next();
double q = s.nextDouble();
double w = s.nextDouble();
if (a[i].equals("patient")) {
sum -= (double) (q-q * w);
} else {
sum += (double) (q * w);
}
}
System.out.println(sum);
for (int j = 0; j < n; j++) {
switch (a[j]) {
case "doctor":
System.out.println("我是医生，我的任务是参与会诊、进行手术");
break;
case "nurse":
System.out.println("我是护士，我的任务是照顾病人、协助医生");
break;
default:
System.out.println("我是病人，我需要配合医务人员接收治疗");
break;
}
}
}
}

