public class Main{
    public static void main(String[] args) {
        Scanner sc=new Scanner(System.in);
        int a,b,num;
        boolean have[]=new boolean[10005];
        int prime[]=new int[10005];
        for(int i=0;i<=10000;i++){
            have[i]=true;
        }
        num=0;
        have[0]=have[1]=false;
        for(int i=2;i<=10000;i++){
            if(have[i]){
                prime[num++]=i;
                for(int j=i*2;j<=10000;j+=i){
                    have[j]=false;
                }
            }
        }
        a=sc.nextInt();
        b=sc.nextInt();
        int now;
        boolean flog;
        for(int i=a;i<=b;i++){
            now=i;
            flog=true;
            System.out.print(i+"=");
            for(int j=0;j<num&&now>1;j++){
                while (now%prime[j]==0){
                    now/=prime[j];
                    if(flog){
                        System.out.print(prime[j]);
                        flog=false;
                    }
                    else {
                        System.out.print("*"+prime[j]);
                    }
                }
            }
            System.out.println();
        }
        return;
    }
}

