		width=1;
		height=1;
	}
	public Rectangle(double width, double height) {
		this.width = width;
		this.height = height;
	}
	public double getArea() {
		return this.width*this.height;
	}
	public double getPerimeter() {
		return (this.height+this.width)*2;
	}
