		}else if (type == 3) {
			appliances[i] = new AirConditioner(w);
		}
	}	
	}
	public int adds() {
		for (int i = 0; i < appliances.length; i++) {
			num+=appliances[i].getWeigth();
		}
		return num;
	}


}

