		for(int i = 0; i < shape.length; i ++) {
			area = shape[i].getArea()+area;
		}
		return area;
	}
	public double sumAllPerimeter(Shape[] shape) {
		double per = 0;
		for(int i = 0; i < shape.length; i ++) {
			per = shape[i].getPerimeter()+per;
		}
		return per;
	}
}

