abstract class Shape{
    abstract double getPerimeter();
    abstract double getArea();
}
class Square extends Shape{
    double fang;
    public Square(double fang){
        this.fang = fang;
    }
    double getPerimeter(){
        return 4 * fang;
    }
    double getArea(){
        return fang * fang;
    }
}
class Rectangle extends Square{
    double jv2;
    public Rectangle(double fang,double jv2){
        super(fang);
        this.jv2 = jv2;
    }
    double getPerimeter(){
        return 2 * (fang + jv2);
    }
    double getArea(){
        return fang * jv2;
    }
}
class Circle extends Shape{
    double r;
    public Circle(double r){
        this.r = r;
    }
    double getPerimeter(){
        return Math.PI * r * 2;
    }
    double getArea(){
        return Math.PI * r * r;
    }
}

