class Track{
	Scanner sc=new Scanner(System.in);
	int n=sc.nextInt();
	int sum;
	Appliance[] app=new Appliance[n];
	public void getScan(){
		for(int i=0;i<n;i++) {
		    int type=sc.nextInt();
		    int w=sc.nextInt();
		    if(type==1) {
		    	app[i]=new TV(w);
		    }else if(type==2) {
		    	app[i]=new WashMachine(w);
		    }else if(type==3) {
		    	app[i]=new AirConditioner(w);
		    }
	    }
	}
	public int getSumWeight() {
		for(int i=0;i<n;i++) {
			sum+=app[i].getWeight();
		}
		return sum;
	}

}

