class Truck{

	Scanner scan = new Scanner(System.in);
	int num=0;
	int n = scan.nextInt();//获取家电数目	
	private Appliance[] appliances = new Appliance[n];//定义集合

	public void add() {//循环输入家电信息
	for (int i = 0; i < appliances.length; i++) {
		int type = scan.nextInt();//获得编号
		int w = scan.nextInt();//获得重量
		if (type==1) {
			appliances[i]=new TV(w);
		} else if(type==2) {
			appliances[i] = new WashMachine(w);
		}else if (type == 3) {
			appliances[i] = new AirConditioner(w);
		}
	}	
	}
	public int adds() {
		for (int i = 0; i < appliances.length; i++) {
			num+=appliances[i].getWeigth();
		}
		return num;
	}


}

