import java.util.Arrays;
import java.util.Scanner;
class Shape {
	double PI = 3.14;
	public double getPerimeter() {
		return 0;
	}
	public double getArea() {
		return 0;
	}
	public double sumAllArea(Shape[] shape) {
		double area = 0;
		for(int i = 0; i < shape.length; i ++) {
			area = shape[i].getArea()+area;
		}
		return area;
	}
	public double sumAllPerimeter(Shape[] shape) {
		double per = 0;
		for(int i = 0; i < shape.length; i ++) {
			per = shape[i].getPerimeter()+per;
		}
		return per;
	}
}

class Rectangle extends Shape {
	private int width;
	private int length;
	public Rectangle(int width, int length) {
		super();
		this.width = width;
		this.length = length;
	}
	public int getWidth() {
		return width;
	}
	public void setWidth(int width) {
		this.width = width;
	}
	public int getLenth() {
		return length;
	}
	public void setLenth(int length) {
		this.length = length;
	}
	public double getPerimeter() {
		return (width+length)*2;
	}
	public double getArea() {
		return width*length;
	}
	@Override
	public String toString() {
		return "Rectangle [width=" + width + ", length=" + length + "]";
	}
	public double sumAllArea() {
		return 0;
	}
}

class Circle extends Shape {
	private int radius;
	public Circle(int radius) {
		super();
		this.radius = radius;
	}
	public int getRadius() {
		return radius;
	}
	public void setRadius(int radius) {
		this.radius = radius;
	}
	public double getPerimeter() {
		return radius*2*PI;
	}
	public double getArea() {
		return radius*radius*PI;
	}
	@Override
	public String toString() {
		return "Circle [radius=" + radius + "]";
	}
}

public class Main {
	public static void main(String[] args) {
		Scanner sc = new Scanner(System.in);
		int n = sc.nextInt();
		Shape[] s = new Shape[n];
		Shape sh = new Shape();

		for(int i = 0; i < n; i++) {
			String str = sc.next();
			if(str.equals("rect")) {
				s[i] = new Rectangle(sc.nextInt(),sc.nextInt());
			}else {
				s[i] = new Circle(sc.nextInt());
			}
		}

		System.out.println(sh.sumAllPerimeter(s)+"\n"+sh.sumAllArea(s));
		System.out.println(Arrays.toString(s));

		for(int i = 0; i < s.length; i++) {
			System.out.println(s[i].getClass()+","+s[i].getClass().getSuperclass());
		}

	}
}

