class Rectangle extends Square{

	double wide;
	public Rectangle(double length,double wide) {
		super(length);
		this.wide=wide;
		// TODO Auto-generated constructor stub
	}
	@Override
	double getPerimeter() {

		return this.length*2+this.wide*2;
	}

	@Override
	double getArea() {
		// TO
		return this.length*this.wide;
	}



}
