abstract class Shape{
    //周长
    abstract double getPerimeter();
    abstract double getArea();//面积
}

//正方形
class Square extends Shape{
    private double SquareLong;//边长

    @Override
    double getPerimeter() {
        return 4*SquareLong ;
    }

    @Override
    double getArea() {
        return SquareLong*SquareLong ;
    }

    public double getSquareLong() {
        return SquareLong;
    }

    public void setSquareLong(double squareLong) {
        SquareLong = squareLong;
    }
}
