class Rectangle extends Shape{
    private double RectangleLong;//长
    private double RectangleWidth;//边宽

    public double getRectangleLong() {
        return RectangleLong;
    }

    public void setRectangleLong(double rectangleLong) {
        RectangleLong = rectangleLong;
    }

    public double getRectangleWidth() {
        return RectangleWidth;
    }

    public void setRectangleWidth(double rectangleWidth) {
        RectangleWidth = rectangleWidth;
    }

    @Override
    double getPerimeter() {
        return 2*RectangleLong+2*RectangleWidth ;
    }

    @Override
    double getArea() {
        return RectangleLong*RectangleWidth ;
    }
}

//长方形
class Circle extends Shape{
    private double r;//半径

    public double getR() {
        return r;
    }

    public void setR(double r) {
        this.r = r;
    }

    @Override
    double getPerimeter() {
        return 2*Math.PI*r ;
    }

    @Override
    double getArea() {
        return Math.PI*r*r  ;
    }
}

