            int sum=0;
            for(int j=1;j<=Math.sqrt(i);j++){
                if(i%j==0){
                    sum++;
                }
            }
            if(sum==1){
                System.out.println(i+"="+i);
            }else{
                int j;
                for(j=2;j<=i;j++){
                    if(i%j==0){
                        String str=i+"="+j;
                        if(i/j!=0){
                            S(i/j,j,i,str);
                        }
                        break;
                    }
                }

            }
        }
    }
   public static void S(int n, int j, int m, String s){
        int sum=0;
        for(int i = 1; i<= Math.sqrt(n); i++){
            if(n%i==0){
                sum++;
            }
        }
        if(sum==1){
            s= s+"*"+n;
            System.out.println(s);
        }else{
            for(j=2;j<=n;j++){
                if(n%j==0){
                    if(n/j!=0){
                        s=s+"*"+j;
                        S(n/j,j,n,s);
                    }
                    break;
                }
            }
        }
    }
}

