        int min_index=0;
        Integer[] num = new Integer[str.length];
        for(int i=0;i<str.length;i++){
                num[i]= Integer.parseInt(str[i]);
        }

        for(int i =0;i<num.length;i++){
            if(num[i]>num[max_index]){
                max_index = i;
            }
            if(num[min_index]>num[i]){
                min_index = i;
            }
        }
        int temp= num[0];
        if(str.length== 2){
            num[0] = num[max_index];
            num[max_index]=temp;
        }else if(max_index ==(str.length-1)&&min_index ==0||max_index ==0&&min_index ==(str.length-1)){
            num[0] = num[max_index];
            num[max_index]=temp;
        }else if(str.length==3&&max_index==1&&min_index==0){
            num[0] = num[max_index];
            num[max_index]=temp;
            temp=num[1];
            num[1]=num[2];
            num[2]=temp;
        }else{
            num[0] = num[max_index];
