public class Main {
    public static void main(String[] args) {
        try {
            Scanner sc = new Scanner(System.in);
            int m = sc.nextInt();
            int n = sc.nextInt();
            int a = sc.nextInt();
            if (a!=90&&a!=180&&a!=(-90)){
                System.out.print("angle data error");
                return;
            }
            int[][] arr = new int[m][n];
            for (int i = 0; i < m; i++) {
                for (int j = 0; j < n; j++) {
                    int t = sc.nextInt();
                    if (t<0||t>255){
                        System.out.print("matrix data error");
                        return;
                    }
                    arr[i][j] = t;
                }
            }
            switch (a){
                case 90:
                    for (int i = n-1; i >= 0; i--) {
                        for (int j = 0; j < m; j++) {
                            System.out.print(arr[j][i]);
                            if (j!=m-1){
                                System.out.print(" ");
                            }
                        }
                        if (i!=0){
                            System.out.println();
                        }
                    }
                    break;
                case 180:
                    for (int i = m-1; i >= 0 ; i--) {
                        for (int j = n-1; j >= 0 ; j--) {
                            System.out.print(arr[i][j]);
                            if (j!=0){
                                System.out.print(" ");
                            }
                        }
                        if (i!=0){
                            System.out.println();
                        }
                    }
                    break;
                case -90:
                    for (int i = 0; i < n; i++) {
                        for (int j = m-1; j >= 0 ; j--) {
                            System.out.print(arr[j][i]);
                            if (j!=0){
                                System.out.print(" ");
                            }
                        }
