import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int a = sc.nextInt();
        int b = sc.nextInt();
        sc.close();
        for(int i = a;i <= b;i++)
        {
            Decompose(i);
        }

    }
    private static void Decompose(int n)
    {
        System.out.print(n+"=");
        for(int i=2;i<=n;i++)
        {
            while(n % i == 0 && n!=i )
            {
                n/=i;
                System.out.print(i+"*");
            }
            if(n==i)
            {
                System.out.print(i);
                System.out.println();
                break;
            }
        }

    }
}

