public final class Main {
   public static void main(String[] args) {
      Scanner mScanner = new Scanner(System.in);
      try {
         String mSN;
         String mName;
         int mAge;
         int mLength = mScanner.nextInt();
         if (mLength <= 0) mLength = 1;
         Student[] stu = new Student[mLength];
         mLength--;
         for (int i = 0; i <= mLength; i++) {
            mSN = mScanner.next();
            mName = mScanner.next();
            mAge = mScanner.nextInt();
            stu[i] = new Student(mSN, mName, mAge);
            System.out.println((mAge >= 7 && mAge <= 60) ? stu[i] : "bad");
         }
      } catch (InputMismatchException e) {
      } finally {
         mScanner.close();
      }
   }

   private static final class Student {
      private String mSN;
      private String mName;
      private int mAge;

      public Student(String sn, String name, int age) {
         mSN = sn;
         mName = name;
         mAge = age;
      }

      @Override
      public String toString() {
         return mName + " " + mSN + " " + mAge;
      }
   }
}

