                        System.out.print("matrix data error");
                        return;
                    }
                    arr[i][j] = t;
                }
            }
            switch (a){
                case 90:
                    for (int i = n-1; i >= 0; i--) {
                        for (int j = 0; j < m; j++) {
                            System.out.print(arr[j][i]);
                            if (j!=m-1){
                                System.out.print(" ");
                            }
                        }
                        if (i!=0){
                            System.out.println();
                        }
                    }
