			f(i);
			System.out.println();
		}
	}


	public static void f(int i) {
		// 判断是否质数
		boolean b = true;
		int d = i;
		for (int j = 2; j < i; j++) {
			if (i % j == 0) {
				b = false;
				break;
			}
		}
		if (b) {
			System.out.print(+d);
		} else {
			for (int j = 2; j < d; j++) {
				if (d % j == 0) {
					d = d / j;
					System.out.print(j + "*");
					f(d);
					break;
				}
			}

		}
	}
}

