import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner input = new Scanner(System.in);
        while (input.hasNextInt()) {
            int N = input.nextInt();
            int[][] ints = new int[N][N];
            for (int i = 0; i < N; i++) {
                for (int j = 0; j < N; j++) {
                    ints[i][j] = input.nextInt();
                }
            }
            boolean isHave = false;
            for (int i = 0; i < N; i++) {
                for (int j = 0; j < N; j++) {
                    if (compare(ints,i,j,N)){
                        isHave = true;
                        System.out.printf("%d ",ints[i][j]);
                    }
                }
            }
            if (!isHave){
                System.out.print("none");
            }
            System.out.println();
        }
    }
    public static boolean compare(int[][] ints,int i,int j,int N){
        int num = ints[i][j];
        for (int x = i-1; x <=i+1; x++) {
            for (int y = j-1; y <= j+1; y++) {
                if ((x>=0&&x<N)&&(y>=0&&y<N)&&(x!=i||y!=j)&&(ints[x][y]>=num)){
                    return false;
                }
            }
        }
        return true;
    }
}

