import java.util.Scanner;
public class Main {
    public static void main(String[] args) {
        Scanner reader=new Scanner(System.in);
        int n=reader.nextInt();
        if(n>=1&&n<=13){
            int a[][]=new int[n][n];
            for(int i=0;i<n;i++){
                for(int j=0;j<=i;j++){
                    if(j==0||j==i)
                        a[i][j]=1;
                    else
                        a[i][j]=a[i-1][j-1]+a[i-1][j];
                    System.out.printf("%-4d",a[i][j]);
                }
                System.out.println();
            }
        }
    }
}

