import java.util.Arrays;
import java.util.Scanner;

class Main{
    public static void main(String[] args) {
        try (Scanner scanner = new Scanner(System.in)) {
            int n = scanner.nextInt();
            scanner.nextLine();
            Shape[] s = new Shape[n];
            for (int i = 0; i < s.length; i++) {
                String flag = scanner.next();
                scanner.nextLine();
                if (flag.equals("rect")) {
                    s[i] = new Rectangle(scanner.nextInt(),scanner.nextInt());
                } else if (flag.equals("cir")) {
                    s[i] = new Circle(scanner.nextInt());
                }
            }
            System.out.println(Shape.sumAllPerimeter(s));
            System.out.println(Shape.sumAllArea(s));
            System.out.println(Arrays.toString(s));
            for (Shape shape : s) {
                System.out.println(shape.getClass()+","+shape.getClass().getSuperclass());
            }
        }
    }
}
abstract class Shape {
    final static double PI = 3.14;
    public abstract double getPerimeter();
    public abstract double getArea();

    public static double sumAllArea(Shape[] array){
        double sum = 0 ;
        for (Shape shape : array) {
            sum+=shape.getArea();
        }
        return sum;
    }

    public static double sumAllPerimeter(Shape[] array){
        double sum = 0 ;
        for (Shape shape : array) {
            sum+=shape.getPerimeter();
        }
        return sum;
    }
}
class Rectangle extends Shape {
    private int width;
    private int length;

    public Rectangle(int width,int length){
        this.setLength(length);
        this.setWidth(width);
    }

    public void setLength(int length) {
        this.length = length;
    }

    public void setWidth(int width) {
        this.width = width;
    }

    public int getWidth() {
        return width;
    }

    public int getLength() {
        return length;
    }

    @Override
    public String toString() {
        // TODO Auto-generated method stub
        return "Rectangle [width="+this.getWidth()+", length="+this.getLength()+"]";
    }

    @Override
    public double getPerimeter() {
        // TODO Auto-generated method stub
        return 2*(this.getWidth()+this.getLength());
    }

    @Override
    public double getArea() {
        // TODO Auto-generated method stub
        return this.getWidth()*this.getLength();
    }
}
class Circle extends Shape {
    private int radivs;

    public Circle(int radius){
        this.setRadivs(radius);
    }

    public void setRadivs(int radivs) {
        this.radivs = radivs;
    }

    public int getRadivs() {
        return radivs;
    }

    @Override
    public String toString() {
        // TODO Auto-generated method stub
        return "Circle [radius="+this.getRadivs()+"]";
    }

    @Override
    public double getPerimeter() {
        // TODO Auto-generated method stub
        return 2*PI*this.getRadivs();
    }

    @Override
    public double getArea() {
        // TODO Auto-generated method stub
        return PI*this.getRadivs()*this.getRadivs();
    }
}

